import React,{Component} from 'react';
import "./Skills.css"
import ProgressBar from '../ProgressBar/ProgressBar';
import SkillBar from '../Skills/Skills'
class Skills extends Component{
    render(){

        return(
            <div id="skills-container" className="skills-container">
                <div className="skills-title title">My Skills</div>
                <div>
                <div className="right">
                <ProgressBar title={'C, Linux, OOP, Network, TCP/UDP'} color={'#00ccff'} level="expert" percent={90}/>
                <ProgressBar title={'Java , C++, Html, Css, JavaScript, Xml'} color={'#00ccff'} level="expert" percent={20}/>
                </div>
                <div className="left">
                <ProgressBar title={'Android, Web Application'} color={'#00ccff'} level="expert" percent={70}/>
                <ProgressBar title={'Android, Web Application'} color={'#00ccff'} level="expert" percent={70}/>
                </div>
                </div>
            </div>

        );
    }
}

export default Skills;
